import { Container } from "react-bootstrap";
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import TelaMenu from "./TelasDeCadastro/TelaMenu";
import Tela404 from "./TelasDeCadastro/Tela404";
import TelaCadastroDeCamareiro from "./TelasDeCadastro/TelaDeCadastroDeCamareiro";
import TelaCadastroDeAtividadeCamareiro from "./TelasDeCadastro/TelaDeCadastroDeAtividadeCamareiro";
import FormAlteracaoCamareiro from "./formularios/FormAlteracaoCamarareiro";
import FormExclusaoCamareiro from "./formularios/FormExclusaoCamareiro";
import FormAlteracaoAtividadeCamareiro from "./formularios/FormAlteracaoAtividadeCamarareiro";
import FormExclusaoAtividadeCamareiro from "./formularios/FormExclusaoAtividadeCamareiro";

function App() {
  return (
    <Container className="w-100">
      <BrowserRouter>
      <Routes>
        <Route path="/cadastroCamareiro" element={<TelaCadastroDeCamareiro/>}/>      
        <Route path="/alterarCamareiro" element={<FormAlteracaoCamareiro/>}/>
        <Route path="/excluirCamareiro" element={<FormExclusaoCamareiro/>}/>
        <Route path="/cadastroAtividadeCamareiro" element={<TelaCadastroDeAtividadeCamareiro/>}/>        
        <Route path="/alterarAtividadeCamareiro" element={<FormAlteracaoAtividadeCamareiro/>}/>        
        <Route path="/excluirAtividadeCamareiro" element={<FormExclusaoAtividadeCamareiro/>}/>        
        <Route path="/" element={<TelaMenu/>}/>
        <Route path="*" element={<Tela404/>}/>
      </Routes>
      </BrowserRouter>
    </Container>
  );
}

export default App;
